import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';


import slide_image_1 from '../images/slide1.jpg';
import slide_image_2 from '../images/slide2.jpg';
import slide_image_3 from '../images/slide3.jpg';

export function Galeria() {
  return (
    <section class="w-full bg-[#FFEFCD] pb-10 flex flex-col items-center">
      <div class="w-2/3">
        <h1 class="text-4xl text-[#424530] font-lucida font-bold pb-2">Galeria</h1>
      </div>
      <div class="w-[85%] flex flex-col items-center">
        <Swiper
          effect={'coverflow'}
          grabCursor={true}
          centeredSlides={true}
          loop={true}
          slidesPerView={'auto'}
          coverflowEffect={{
            rotate: 0,
            stretch: 0,
            depth: 100,
            modifier: 2.5,
          }}
          pagination={{ el: '.swiper-pagination', clickable: true }}
          navigation={{
            nextEl: '.swiper-button-next',
            prevEl: '.swiper-button-prev',
            clickable: true,
          }}

          className="swiper_container"
        >
          <SwiperSlide>
            <img className='slideImg' src={slide_image_1} alt="slide_image" />
          </SwiperSlide>
          <SwiperSlide>
            <img className='slideImg' src={slide_image_2} alt="slide_image" />
          </SwiperSlide>
          <SwiperSlide>
            <img className='slideImg' src={slide_image_3} alt="slide_image" />
          </SwiperSlide>


          <div className="slider-controler">
            <div className="swiper-button-prev slider-arrow">
              <ion-icon name="arrow-back-outline"></ion-icon>
            </div>
            <div className="swiper-button-next slider-arrow">
              <ion-icon name="arrow-forward-outline"></ion-icon>
            </div>
            <div className="swiper-pagination"></div>
          </div>
        </Swiper>
      </div>
    </section>
  );
}
